import classes from "./Header.module.css";
import Button from "../UI/Button";
import logoImg from "../../assets/logo.png";


const Header = (props) => {


  return (
    <div className={classes.header}>
        <input type="checkbox" id={classes.togglemenu}/>
      <label for={classes.togglemenu}>
                <i className="fas fa-bars" id={classes.btn}> </i>
                <i className="fas fa-times" id={classes.cancel}></i>
            </label>
      <ul className={classes.pgln}>
      <li><label for={classes.togglemenu}>
              <i className="fas fa-times" id={classes.cancel}></i>
            </label></li>
        <li>
          {" "}
          <a href="/"> Services </a>
        </li>
        <li>
          {" "}
          <a href="/"> Industry </a>
        </li>
        <li>
          {" "}
          <a href="/"> About </a>
        </li>
        <li>
          {" "}
          <a href="/"> Contact Us </a>
        </li>
      </ul>{" "}
      <div className={classes.imgCont}>
        {" "}
        <img src={logoImg} alt="logo" />{" "}
      </div>{" "}
      <div className={classes.btnCont}>
        <Button className={classes.btn}> Login </Button>{" "}
        <Button className={classes.btn}> Free trail </Button>{" "}
      </div>{" "}
    </div>
  );
};

export default Header;
